	add("sandshoe", "{\"term\":\"sandshoe\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|sand|shoe|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sports or walking shoe with canvas upper and rubber sole; a sneaker\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, Pete Thomas, \u0027The Coalminers of Queensland\u0027, Volume I: Creating the Traditions, Queensland Colliery Employees Union, %22sandshoes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22sandshoe%22|%22sandshoes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dW_V38jqzTE\u0026amp;sig\u003dTpRhi8inUACB9lBc_Gd0OrOctZY\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deUIeUMrANOWViQeOo4HQAg\u0026amp;redir_esc\u003dy page 325\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Later, however, the union ran into a problem of a severe shortage of \u0027\u0027sandshoes\u0027\u0027 in Queensland. The rationing authorities, in reply to a union request on this, said that the Chief Inspector of Coalmines had condemned use of \u0027\u0027sandshoes\u0027\u0027 in mines as being “not conducive to health or safety\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Peter Plowman, \u0027Across the Sea to War: Australian and New Zealand Troop Convoys from 1865 through two World Wars to Lorea and Vietnam\u0027, Rosenberg Publishing, Australia, %22sandshoes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dQs2tqbetqp\u0026amp;sig\u003dJu3CpS1LeG9hfgJ960BHeWDvrqg\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deUIeUMrANOWViQeOo4HQAg\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"%22sandshoes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 387\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Sandshoes\u0027\u0027 had been issued for shipboard use, to avoid damage to the decks by hob-nailed boots\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Melissa Harper, \u0027The Ways of the Bushwalker: On Foot in Australia\u0027, UNSW Press, %22sandshoes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dyitvw4JNlu\u0026amp;sig\u003dRyYpYk-Vw9a_1yLHPkQ0tbolDu4\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deUIeUMrANOWViQeOo4HQAg\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"%22sandshoes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 272\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027sandshoe\u0027\u0027 versus the boot; this is an issue that has stirred the blood of bushwalkers for more than fifty years.The demise of the ubiquitous hob-nailed boot (circa 1950s) in favour of a boot with a patterned rubber sole generated concern, but the popularity of a boot that combined a rubber sole and a canvas upper with no ankle support simply went too far for some\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, \u0027Kieron Smith, Boy\u0027, Penguin 2009, p. 81\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"But because yer \u0027\u0027sandshoes\u0027\u0027, if they were dirty, it was a point off yer team, so ye were just to try yer hardest\", \"priority\":11}]}, \"synonyms\":{}}");

	add("sandthorn", "{\"term\":\"sandthorn\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|sand|thorn|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A species of sea buckthorn, found from western Europe to northwestern China\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, \u0026quot;Professor Link\u0026quot;, \u0026quot;Contributions to the Botanical Geography of the South of Europe\u0026quot; in \u0027The Analyst\u0027 vol. 7 [http://books.google.com/books?id\u003dmNwEAAAAQAAJ], page 50\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;They likewise must ascend mountains by degrees and not make extraordinary leap of the \u0027\u0027Sandthorn\u0027\u0027, \u0027Hippophae rhamnoides\u0027...\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027, Ole Olufsen, \u0027The Emir of Bokhara and His Country\u0027 [http://books.google.com/books?id\u003drlbGWH30tykC], page 269\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;... the first \u0027\u0027sandthorns\u0027\u0027 and willows are met with at an altitude of 26-2700 meters.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Veronika Van Duin, \u0027A Rainbow Over the River: Experiences of Life, Death, and Other Worlds\u0027 [http://books.google.com/books?id\u003dWcl-e_BxbzkC], ISBN 1902636473, page 159\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;The breeze is soft and singing through the \u0027\u0027sandthorn\u0027\u0027 tree.\u0026quot\", \"priority\":7}]}, \"synonyms\":{}}");

